import React from 'react';
import Taiwan from './../images/Taiwan.jpg';
import styles from './MainSection.module.css';
import { View, Image, StyleSheet } from 'react-native';

const MainSection = () => {
    return (
      <View style={styles.container}>
        <Image
          style={styles.logo}
          source={Taiwan}
        />
      </View>
    );
  }

  export default MainSection;
